('230f8464c03ab1dc4fbd4bc332b6b776','Page A Page A\n             \n            \n         \n    \n         \n             \n                Page B  '),
('3d798c3f120fdabe32985de46a5fc2fd','FC Bigfoot Events\n                                 \n                            \n                     \n                \n                     \n                        \n                                 \n                                 \n                                    \n                                    News\n                                 \n                            \n                     \n                \n                     \n                        \n                                 \n                                 \n                                    \n                                    Club\n                                 \n                                 \n                                    \n                                        \n                                                 \n                                                    History\n                                                 \n                                            \n                                    \n                                        \n                                                 \n                                                    Membership\n                                                 \n                                            \n                                    \n                                        \n                                                 \n                                                    Contact\n                                                 \n                                            \n                                    \n                                 \n                            \n                     \n                \n                     \n                        \n                                 \n                                 \n                                    \n                                    Team\n                                 \n                            \n                     \n                \n                     \n                        \n                                 \n                                 \n                                    \n                                    Sponsors\n                                 \n                            \n                     \n                \n             \n\n            \n                 \n            \n            \n                 \n                     Contact Us \n                 \n            \n         \n     \n \n\n\n\n\n \n    \n    \n    \n\n \n     \n         \n              \n             \n                 FC Bigfoot Fuerteventura \n                 23 years of passion and dedication \n                 \n                    Join today\n                 \n             \n         \n     \n     \n \n\n\n\n\n\n    \n     \n         \n            \n\n\n \n    \n        \n\n\n\n    \n    \n            \n                \n                     \n                        \n\n  \n     \n      \r\n\r\n  \r\n       \r\n        Our latest Game Results\r\n       \r\n    \r\n\r\n\n      \r\n\r\n\r\n\n     \n  \n\n\n\n                     \n                \n            \n        \n    \n \n\n\n\n\n\n        \n     \n         \n             \n                \n                     \n                         \n                             \n                             \n                                \n                                        3 : 0\n                                    \n                             \n                             \n                         \n                         \n                            SurfCamp League @ Super Feet Stadium\n                         \n                         \n                            29.02.2024\n                         \n                     \n                \n                     \n                         \n                             \n                             \n                                \n                                        0 : 0\n                                    \n                             \n                             \n                         \n                         \n                            SurfCamp League @ Super Feet Stadium\n                         \n                         \n                            05.03.2024\n                         \n                     \n                \n                     \n                         \n                             \n                             \n                                \n                                        2 : 1\n                                    \n                             \n                             \n                         \n                         \n                            SurfCamp League @ Luton Bowl\n                         \n                         \n                            09.03.2024\n                         \n                     \n                \n                     \n                         \n                             \n                             \n                                \n                                        13 : 1\n                                    \n                             \n                             \n                         \n                         \n                            SurfCamp League @ Super Feet Stadium\n                         \n                         \n                            18.03.2024\n                         \n                     \n                \n                     \n                         \n                             \n                             \n                                \n                                        2 : 1\n                                    \n                             \n                             \n                         \n                         \n                            SurfCamp League @ Super Feet Stadium\n                         \n                         \n                            21.03.2024\n                         \n                     \n                \n                     \n                         \n                             \n                             \n                                \n                                        2 : 2\n                                    \n                             \n                             \n                         \n                         \n                            SurfCamp League @ Woodland Arena\n                         \n                         \n                            02.04.2024\n                         \n                     \n                \n                     \n                         \n                             \n                             \n                                \n                                        TBA\n                                    \n                             \n                             \n                         \n                         \n                            SurfCamp League @ Burns\' Power Plant\n                         \n                         \n                            09.04.2024\n                         \n                     \n                \n                     \n                         \n                             \n                             \n                                \n                                        TBA\n                                    \n                             \n                             \n                         \n                         \n                            SurfCamp League @ Wolverine Palace\n                         \n                         \n                            16.04.2024\n                         \n                     \n                \n                     \n                         \n                             \n                             \n                                \n                                        TBA\n                                    \n                             \n                             \n                         \n                         \n                            SurfCamp League @ Super Feet Stadium\n                         \n                         \n                            29.04.2024\n                         \n                     \n                \n                     \n                         \n                             \n                             \n                                \n                                        TBA\n                                    \n                             \n                             \n                         \n                         \n                            SurfCamp League @ Never Ever Arena\n                         \n                         \n                            13.05.2024\n                         \n                     \n                \n             \n         \n     \n\n    \n\n\n\n\n\n\n\n         \n     \n\n    \n     \n        \n\n\n\n  \n     \n      \r\n\r\n  \r\n       \r\n        News\r\n       \r\n    \r\n\r\n\n      \r\n\r\n\r\n\n     \n  \n\n\n\n \n     \n         \n             \n             24 Feb 2024 \n             15th charity tournament  \n             The big soccer spectacle will take place for the 15th time. We have once again invited soccer teams from the region and many have already confirmed their participation.  Our charity tournament is also always a meeting point for all soccer fans in the region to get together, chat or even have a beer together. \n             Learn more    \n         \n     \n     \n         \n             \n             10 Jun 2024 \n             Get ready for another exciting match! \n             On Thursday, 18.04.2023 at 16.30 the time has come, then the current 3rd of the regional league, our FC Bigfoot, meets the rival SurfCamp League. Here is some information about the game: Access to the stadium is possible from 14.30. Catering will be provided. \n             Learn more    \n         \n     \n     \n         \n             \n             13 April 2024 \n             Our new supporter: Luna Media \n             A Powerful Partnership: We\'re thrilled to welcome Luna Media as our newest sponsor! Their support promises to elevate our club to even greater heights, both on and off the field. \n             Learn more    \n         \n     \n \n\n\n\n\n\n \n    \n        \n\n     \n        \n        \n             \n                \n                    \n                         \n                            \n\n        \n \n    \n            \n\n \n\n\n        \n    \n \n\n\n    \n\n\n                         \n                    \n                \n             \n        \n        \n \n\n\n\n    \n    \n             \n                \n                    \n\n  \n     \n      \r\n\r\n  \r\n       \r\n        Your City. Your Club.\r\n       \r\n    \r\n\r\n\n      \r\n\r\n\r\n\n     \n  \n\n\n\n                \n                 With 21 teams, we are once again one of the largest clubs in Fuerteventura this season! We have three senior teams in each age group and at least two youth teams in each age group. In total, we have almost 900 members. We would like to thank everyone who has supported us so actively this season. \n             \n        \n    \n \n\n\n\n\n\n\n  \n     \n      \r\n\r\n  \r\n       \r\n        Our events \r\n       \r\n    \r\n\r\n\n      \r\n\r\n\r\n\n     \n  \n\n\n\n\n\n     \n         \n            \n                 \n                    \n                         \n                    \n                     \n                         \n                            Game Day\n                         \n                        \n                             \n                                Learn more\n                                  \n                             \n       