spect every individual within our clubplayers, coaches, staff, and supporters. Everyone\'s contributions are valued, creating a strong, cohesive team. \n  Openness  Our inclusive and welcoming community embraces diversity. We ensure that everyone feels valued and included, fostering a sense of belonging through transparent and honest communication. \n  Sharing  Collaboration is key at FC Bigfoot. Sharing knowledge, skills, and experiences makes us stronger, inspiring the next generation of players and fans. \n  Friendship and Fun  Football is about building friendships and creating memories. We prioritize camaraderie and enjoyment, believing that a positive and fun atmosphere leads to better performance and a more fulfilling experience. \n FC Bigfoot is more than a clubwe are a community built on shared values. Trust, respect, openness, sharing, friendship, and fun define us. Join us at FC Bigfoot, where values matter and every member is celebrated. \n             \n        \n    \n \n\n\n\n\n \n    \n\n  \n     \n      \r\n\r\n  \r\n       \r\n        Our biggest supporters\r\n       \r\n    \r\n\r\n\n      \r\n\r\n\r\n\n     \n  \n\n\n\n     \n         \n            \n                 \n                    \n                         \n                    \n                 \n            \n                 \n                    \n                         \n                    \n                 \n            \n                 \n                    \n                         \n                    \n                 \n            \n                 \n                    \n                         \n                    \n                 \n            \n                 \n                    \n                         \n                    \n                 \n            \n                 \n                    \n                         \n                    \n                 \n            \n         \n     \n \n\n\n\n     \n\n    \n    \n\n \n     \n         \n  