 simple - due to proper separation of content, configuration and other assets like caches and temporary files.Use any database you likeMySQL/MariaDB, postgreSQL, SQL Server or SQLite - due to the underlying database abstraction. \n  Read TYPO3 Install Guide  \n\n\n    \n\n\n\n    \n\n\n\n\n                         \n                     \n                 \n             \n         \n\n    \n\n\n\n     \n\n    \n\n\n\n\n\n\n\n\n         \n             \n                 \n                    \n\n\n\n                     \n                         \n                            \n    \n    \n\n\n\n    \n\n    \n         \n            \n\n    \n            \n                \n\n    \n             \n                 Reliable Upgrade Paths \n             \n        \n\n\n\n            \n        \n\n\n\n            \n\n\n\n            \n\n\n\n         \n    \n\n\n\n    \n\n     From its inception TYPO3 has emphasized the importance of stable APIs and fullbackwards-compatibility. The TYPO3 core team follows a regular release schedule and take great care to ensure easy, non-breaking updates. \n  TYPO3 CMS Roadmap  '),
