lendars for Thursday, April 18, 2024, at 16:30, as FC Bigfoot, currently third in the regional league, takes on our rivals from SurfCamp League. This is a match you won\'t want to miss!<\\/p>\\n<p><strong>Match Details<\\/strong><\\/p>\\n<ul><li>Date and Time: Thursday, April 18, 2024, at 16:30<\\/li><li>Teams: FC Bigfoot vs. SurfCamp League<\\/li><li>Stadium Access: Gates open at 14:30<\\/li><li>Catering: Food and beverages will be available<\\/li><\\/ul>\\n<p>Join us for an afternoon of intense competition and cheer on FC Bigfoot as they strive to climb the league standings. Bring your friends and family for a memorable day of soccer excitement!<\\/p>\",\"imageborder\":0,\"image_zoom\":0,\"pages\":\"\",\"records\":\"\",\"linkToTop\":0,\"pi_flexform\":null,\"selected_categories\":0,\"category_field\":\"\",\"file_collections\":\"\",\"filelink_size\":0,\"filelink_sorting\":\"\",\"filelink_sorting_direction\":\"\",\"fcbigfoot_button_link\":\"\",\"tx_impexp_origuid\":15,\"crdate\":1744014582,\"t3ver_stage\":0,\"tstamp\":1744014582,\"uid\":4}',0,'0400$1292995152f2f554df58717da65e56f4:4d391f5ef79b8d5d10dffa8a07ca167d'),
(38,1744014582,1,'BE',2,0,5,'tt_content','{\"CType\":\"textpic\",\"categories\":\"0\",\"layout\":\"0\",\"frame_class\":\"default\",\"space_before_class\":\"\",\"space_after_class\":\"\",\"colPos\":\"0\",\"date\":0,\"header_layout\":\"2\",\"header_position\":\"\",\"imagewidth\":0,\"imageheight\":0,\"imageorient\":\"25\",\"imagecols\":\"2\",\"recursive\":\"0\",\"list_type\":\"\",\"sectionIndex\":1,\"hidden\":0,\"starttime\":0,\"endtime\":0,\"l18n_parent\":0,\"l18n_diffsource\":\"{\\\"CType\\\":\\\"\\\",\\\"colPos\\\":\\\"\\\",\\\"header\\\":\\\"\\\",\\\"header_layout\\\":\\\"\\\",\\\"header_link\\\":\\\"\\\",\\\"subheader\\\":\\\"\\\",\\\"bodytext\\\":\\\"\\\",\\\"assets\\\":\\\"\\\",\\\"imagewidth\\\":\\\"\\\",\\\"imageheight\\\":\\\"\\\",\\\"imageborder\\\":\\\"\\\",\\\"imageorient\\\":\\\"\\\",\\\"imagecols\\\":\\\"\\\",\\\"image_zoom\\\":\\\"\\\",\\\"layout\\\":\\\"\\\",\\\"frame_class\\\":\\\"\\\",\\\"space_before_class\\\":\\\"\\\",\\\"space_after_class\\\":\\\"\\\",\\\"sectionIndex\\\":\\\"\\\",\\\"linkToTop\\\":\\\"\\\",\\\"categories\\\":\\\"\\\",\\\"sys_language_uid\\\":\\\"\\\",\\\"hidden\\\":\\\"\\\",\\\"starttime\\\":\\\"\\\",\\\"endtime\\\":\\\"\\\",\\\"fe_group\\\":\\\"\\\",\\\"editlock\\\":\\\"\\\",\\\"rowDescription\\\":\\\"\\\"}\",\"bullets_type\":\"0\",\"cols\":\"0\",\"table_class\":\"\",\"table_delimiter\":\"124\",\"table_enclosure\":\"0\",\"table_header_position\":\"0\",\"table_tfoot\":0,\"target\":\"\",\"uploads_description\":0,\"uploads_type\":\"0\",\"icon_type\":\"default\",\"icon_color\":\"#FFFFFF\",\"icon_background\":\"#333333\",\"items_per_page\":10,\"subitems_header_layout\":\"2\",\"fcbigfoot_game_results_mode\":\"slider\",\"pid\":11,\"sorting\":64,\"fe_group\":\"\",\"rowDescription\":\"\",\"editlock\":0,\"sys_language_uid\":0,\"l10n_source\":0,\"l10n_state\":null,\"table_caption\":null,\"fcbigfoot_button_text\":\"\",\"header\":\"FC Bigfoot\'s 15th Charity Tournament\",\"header_link\":\"\",\"subheader\":\"\",\"bodytext\":\"<p>FC Bigfoot proudly announces the 15th edition of our charity tournament! This beloved event unites soccer enthusiasts, players, and supporters from across the region for a day filled with thrilling matches and community spirit. For the 15th time, we host a marquee event showcasing local soccer talent and fierce competition. Teams from the region have confirmed their participation, promising an exciting display of sportsmanship and skill.<\\/p>\\n<p><strong>Bringing the Community Together<\\/strong><br \\/>Our charity tournament is more than just a series of soccer matches; it\'s a vibrant gathering point for all soccer fans in the region. It\'s a place where old friends reconnect, new friendships are built, and everyone can share in the collective joy of the sport. Whether you\'re a real soccer fan or someone who enjoys the lively atmosphere, there\'s something for everyone at our event. Beyond the action on the pitch, the tournament offers a perfect setting for families and friends to spend a memorable day together. As the matches unfold, spectators can enjoy a variety of food and beverage options, including the chance to relax and chat over a cold beer. There will be activities for children, ensuring that even the youngest fans have a great time.<\\/p>\\n<p><strong>Supporting a Worthy Cause<\\/strong><br \\/>At its heart, the charity tournament is about giving back to the community. Proceeds from the event will go towards local charities, supporting initiatives that make a real difference in the lives of those in need. By attending and participating, you\'re not only enjoying a fantastic day of soccer but also contributing to a greater cause.<br \\/>Mark your calendars and gather your friends and family for an unforgettable day of soccer, fun, and community spirit. The 15th charity tournament hosted by FC Bigfoot is more than just an event; it\'s a celebration of everything we love about the game and the bonds it creates.<\\/p>\\n<p>We look forward to seeing you there, cheering on your favorite teams, enjoying the festivities, and being part of a tradition that continues to strengthen our community year after year. Let\'s make this 15th edition the best one yet!<\\/p>\",\"imageborder\":0,\"image_zoom\":0,\"pages\":\"\",\"records\":\"\",\"linkToTop\":0,\"pi_flexform\":null,\"selected_categories\":0,\"category_field\":\"\",\"file_collections\":\"\",\"filelink_size\":0,\"filelink_sorting\":\"\",\"filelink_sorting_direction\":\"\",\"fcbigfoot_button_link\":\"\",\"tx_impexp_origuid\":14,\"crdate\":1744014582,\"t3ver_stage\":0,\"tstamp\":1744014582,\"uid\":5}',0,'0400$1292995152f2f554df58717da65e56f4:c7626fc9bcba6f70beb6ebc085a400db'),
