(40,1744014582,1,'BE',2,0,7,'tt_content','{\"CType\":\"textpic\",\"categories\":\"0\",\"layout\":\"0\",\"frame_class\":\"default\",\"space_before_class\":\"\",\"space_after_class\":\"\",\"colPos\":\"0\",\"date\":0,\"header_layout\":\"2\",\"header_position\":\"\",\"imagewidth\":0,\"imageheight\":0,\"imageorient\":\"25\",\"imagecols\":\"2\",\"recursive\":\"0\",\"list_type\":\"\",\"sectionIndex\":1,\"hidden\":0,\"starttime\":0,\"endtime\":0,\"l18n_parent\":0,\"l18n_diffsource\":\"\",\"bullets_type\":\"0\",\"cols\":\"0\",\"table_class\":\"\",\"table_delimiter\":\"124\",\"table_enclosure\":\"0\",\"table_header_position\":\"0\",\"table_tfoot\":0,\"target\":\"\",\"uploads_description\":0,\"uploads_type\":\"0\",\"icon_type\":\"default\",\"icon_color\":\"#FFFFFF\",\"icon_background\":\"#333333\",\"items_per_page\":10,\"subitems_header_layout\":\"2\",\"fcbigfoot_game_results_mode\":\"slider\",\"pid\":10,\"sorting\":256,\"fe_group\":\"\",\"rowDescription\":\"\",\"editlock\":0,\"sys_language_uid\":0,\"l10n_source\":0,\"l10n_state\":null,\"table_caption\":null,\"fcbigfoot_button_text\":\"\",\"header\":\"2018 - 2024\",\"header_link\":\"\",\"subheader\":\"Becoming a community\",\"bodytext\":\"<p>The biggest milestone was reached in 2018 when FC Bigfoot was promoted to the regional league for the first time. This achievement marked a turning point in the club\'s history. The promotion brought a new level of visibility and prestige, attracting more fans and support from the local community.<\\/p>\\n<p>Since then, FC Bigfoot has continued its success, not only maintaining its status in the regional league but also expanding its influence nationally. The club\'s strategic focus on youth development has been a cornerstone of this growth. By investing in state-of-the-art training facilities and nurturing young talent through comprehensive development programs, FC Bigfoot has established a strong pipeline of skilled players.<\\/p>\\n<p>FC Bigfoot has solidified its position as a prominent and influential football club, known for its dedication to both competitive success and community engagement. The club\'s ongoing commitment to youth development and national expansion ensures that its legacy will continue to grow in the years to come.<\\/p>\",\"imageborder\":0,\"image_zoom\":0,\"pages\":\"\",\"records\":\"\",\"linkToTop\":0,\"pi_flexform\":null,\"selected_categories\":0,\"category_field\":\"\",\"file_collections\":\"\",\"filelink_size\":0,\"filelink_sorting\":\"\",\"filelink_sorting_direction\":\"\",\"fcbigfoot_button_link\":\"\",\"tx_impexp_origuid\":21,\"crdate\":1744014582,\"t3ver_stage\":0,\"tstamp\":1744014582,\"uid\":7}',0,'0400$1292995152f2f554df58717da65e56f4:ea41b626baac59a1fe0716bc344af5d9'),
(41,1744014582,1,'BE',2,0,8,'tt_content','{\"CType\":\"textpic\",\"categories\":\"0\",\"layout\":\"0\",\"frame_class\":\"default\",\"space_before_class\":\"\",\"space_after_class\":\"\",\"colPos\":\"0\",\"date\":0,\"header_layout\":\"2\",\"header_position\":\"\",\"imagewidth\":0,\"imageheight\":0,\"imageorient\":\"25\",\"imagecols\":\"2\",\"recursive\":\"0\",\"list_type\":\"\",\"sectionIndex\":1,\"hidden\":0,\"starttime\":0,\"endtime\":0,\"l18n_parent\":0,\"l18n_diffsource\":\"\",\"bullets_type\":\"0\",\"cols\":\"0\",\"table_class\":\"\",\"table_delimiter\":\"124\",\"table_enclosure\":\"0\",\"table_header_position\":\"0\",\"table_tfoot\":0,\"target\":\"\",\"uploads_description\":0,\"uploads_type\":\"0\",\"icon_type\":\"default\",\"icon_color\":\"#FFFFFF\",\"icon_background\":\"#333333\",\"items_per_page\":10,\"subitems_header_layout\":\"2\",\"fcbigfoot_game_results_mode\":\"slider\",\"pid\":10,\"sorting\":128,\"fe_group\":\"\",\"rowDescription\":\"\",\"editlock\":0,\"sys_language_uid\":0,\"l10n_source\":0,\"l10n_state\":null,\"table_caption\":null,\"fcbigfoot_button_text\":\"\",\"header\":\"2005 - 2018\",\"header_link\":\"\",\"subheader\":\"Growth, growth, growth!\",\"bodytext\":\"<p>FC Bigfoot was able to expand during this era, marking a significant period of growth and development for the club. Beyond competing in the classic league, FC Bigfoot became known for its community-oriented approach. The club organized various local events and initiatives that engaged the community, fostering a strong bond between the club and its supporters.<\\/p>\\n<p>FC Bigfoot also emphasized inclusivity, ensuring that everyone, regardless of gender or background, had the opportunity to be part of the club. This inclusive approach, combined with their community-focused initiatives, solidified FC Bigfoot\\u2019s reputation as a forward-thinking and community-oriented club.<\\/p>\",\"imageborder\":0,\"image_zoom\":0,\"pages\":\"\",\"records\":\"\",\"linkToTop\":0,\"pi_flexform\":null,