(42,1744014582,1,'BE',2,0,9,'tt_content','{\"CType\":\"textpic\",\"categories\":\"0\",\"layout\":\"0\",\"frame_class\":\"default\",\"space_before_class\":\"\",\"space_after_class\":\"\",\"colPos\":\"0\",\"date\":0,\"header_layout\":\"2\",\"header_position\":\"\",\"imagewidth\":0,\"imageheight\":0,\"imageorient\":\"25\",\"imagecols\":\"2\",\"recursive\":\"0\",\"list_type\":\"\",\"sectionIndex\":1,\"hidden\":0,\"starttime\":0,\"endtime\":0,\"l18n_parent\":0,\"l18n_diffsource\":\"\",\"bullets_type\":\"0\",\"cols\":\"0\",\"table_class\":\"\",\"table_delimiter\":\"124\",\"table_enclosure\":\"0\",\"table_header_position\":\"0\",\"table_tfoot\":0,\"target\":\"\",\"uploads_description\":0,\"uploads_type\":\"0\",\"icon_type\":\"default\",\"icon_color\":\"#FFFFFF\",\"icon_background\":\"#333333\",\"items_per_page\":10,\"subitems_header_layout\":\"2\",\"fcbigfoot_game_results_mode\":\"slider\",\"pid\":10,\"sorting\":64,\"fe_group\":\"\",\"rowDescription\":\"\",\"editlock\":0,\"sys_language_uid\":0,\"l10n_source\":0,\"l10n_state\":null,\"table_caption\":null,\"fcbigfoot_button_text\":\"\",\"header\":\"2001 - 2004\",\"header_link\":\"\",\"subheader\":\"Our first years\",\"bodytext\":\"<p>FC Bigfoot was established in 2001 and swiftly became a well-known name in the local football community. In its early days, the team had to practice on a worn-out field with barely enough equipment for all the players. Despite these challenges, they showed remarkable persistence.<\\/p>\\n<p>One memorable incident occurred during their first season. In a match against a more experienced team, FC Bigfoot was down by four goals at halftime. Instead of giving up, they rallied together and, with sheer determination and teamwork, managed to tie the game by the final whistle. This game became a turning point for the club, showcasing their spirit and winning the respect of fans and competitors alike. From that day on, FC Bigfoot was known for its fighting spirit.<\\/p>\",\"imageborder\":0,\"image_zoom\":0,\"pages\":\"\",\"records\":\"\",\"linkToTop\":0,\"pi_flexform\":null,\"selected_categories\":0,\"category_field\":\"\",\"file_collections\":\"\",\"filelink_size\":0,\"filelink_sorting\":\"\",\"filelink_sorting_direction\":\"\",\"fcbigfoot_button_link\":\"\",\"tx_impexp_origuid\":19,\"crdate\":1744014582,\"t3ver_stage\":0,\"tstamp\":1744014582,\"uid\":9}',0,'0400$1292995152f2f554df58717da65e56f4:367f4f227870d8e2a11496a182574aa3'),
