(47,1744014582,1,'BE',2,0,14,'tt_content','{\"CType\":\"textpic\",\"categories\":\"0\",\"layout\":\"0\",\"frame_class\":\"default\",\"space_before_class\":\"\",\"space_after_class\":\"\",\"colPos\":\"0\",\"date\":0,\"header_layout\":\"2\",\"header_position\":\"\",\"imagewidth\":0,\"imageheight\":0,\"imageorient\":\"25\",\"imagecols\":\"2\",\"recursive\":\"0\",\"list_type\":\"\",\"sectionIndex\":1,\"hidden\":0,\"starttime\":0,\"endtime\":0,\"l18n_parent\":0,\"l18n_diffsource\":\"\",\"bullets_type\":\"0\",\"cols\":\"0\",\"table_class\":\"\",\"table_delimiter\":\"124\",\"table_enclosure\":\"0\",\"table_header_position\":\"0\",\"table_tfoot\":0,\"target\":\"\",\"uploads_description\":0,\"uploads_type\":\"0\",\"icon_type\":\"default\",\"icon_color\":\"#FFFFFF\",\"icon_background\":\"#333333\",\"items_per_page\":10,\"subitems_header_layout\":\"2\",\"fcbigfoot_game_results_mode\":\"slider\",\"pid\":5,\"sorting\":256,\"fe_group\":\"\",\"rowDescription\":\"\",\"editlock\":0,\"sys_language_uid\":0,\"l10n_source\":0,\"l10n_state\":null,\"table_caption\":null,\"fcbigfoot_button_text\":\"\",\"header\":\"Our companions and sponsors\",\"header_link\":\"\",\"subheader\":\"\",\"bodytext\":\"<p>At FC Bigfoot, we are proud to have the backing of our dedicated supporters and companions. These valued partners play a crucial role in the success and growth of our club. Our supporters and companions share our vision and commitment to excellence, helping to foster a strong sense of community. Through their involvement, we are able to enhance our facilities, invest in youth development programs, and organize community outreach initiatives that make a positive impact.<\\/p>\\n<p>By partnering with FC Bigfoot, our supporters and companions benefit from increased visibility and association with a club that values openness, teamwork, and community spirit. We are grateful for their support and look forward to continuing our journey together, achieving new heights and celebrating many successes.<\