(53,1744014582,1,'BE',2,0,20,'tt_content','{\"CType\":\"textpic\",\"categories\":\"0\",\"layout\":\"0\",\"frame_class\":\"default\",\"space_before_class\":\"\",\"space_after_class\":\"\",\"colPos\":\"0\",\"date\":0,\"header_layout\":\"2\",\"header_position\":\"\",\"imagewidth\":0,\"imageheight\":0,\"imageorient\":\"25\",\"imagecols\":\"2\",\"recursive\":\"0\",\"list_type\":\"\",\"sectionIndex\":1,\"hidden\":0,\"starttime\":0,\"endtime\":0,\"l18n_parent\":0,\"l18n_diffsource\":\"{\\\"hidden\\\":\\\"\\\"}\",\"bullets_type\":\"0\",\"cols\":\"0\",\"table_class\":\"\",\"table_delimiter\":\"124\",\"table_enclosure\":\"0\",\"table_header_position\":\"0\",\"table_tfoot\":0,\"target\":\"\",\"uploads_description\":0,\"uploads_type\":\"0\",\"icon_type\":\"default\",\"icon_color\":\"#FFFFFF\",\"icon_background\":\"#333333\",\"items_per_page\":10,\"subitems_header_layout\":\"2\",\"fcbigfoot_game_results_mode\":\"slider\",\"pid\":1,\"sorting\":64,\"fe_group\":\"\",\"rowDescription\":\"\",\"editlock\":0,\"sys_language_uid\":0,\"l10n_source\":0,\"l10n_state\":null,\"table_caption\":null,\"fcbigfoot_button_text\":\"\",\"header\":\"Our Core Values\",\"header_link\":\"\",\"subheader\":\"\",\"bodytext\":\"<p>At FC Bigfoot, our values guide everything we do, both on and off the field. We are dedicated to fostering a community that embodies the spirit of football through trust, respect, openness, sharing, friendship, and fun.<\\/p>\\n<p><strong>Trust and Respect<\\/strong><br \\/>We trust and respect every individual within our club\\u2014players, coaches, staff, and supporters. Everyone\'s contributions are valued, creating a strong, cohesive team.<\\/p>\\n<p><strong>Openness<\\/strong><br \\/>Our inclusive and welcoming community embraces diversity. We ensure that everyone feels valued and included, fostering a sense of belonging through transparent and honest communication.<\\/p>\\n<p><strong>Sharing<\\/strong><br \\/>Collaboration is key at FC Bigfoot. Sharing knowledge, skills, and experiences makes us stronger, inspiring the next generation of players and fans.<\\/p>\\n<p><strong>Friendship and Fun<\\/strong><br \\/>Football is about building friendships and creating memories. We prioritize camaraderie and enjoyment, believing that a positive and fun atmosphere leads to better performance and a more fulfilling experience.<\\/p>\\n<p>FC Bigfoot is more than a club\\u2014we are a community built on shared values. Trust, respect, openness, sharing, friendship, and fun define us. Join us at FC Bigfoot, where values matter and every member is celebrated.<\\/p>\",\"imageborder\":0,\"image_zoom\":0,\"pages\":\"\",\"records\":\"\",\"linkToTop\":0,\"pi_flexform\":null,\"selected_categories\":0,\"category_field\":\"\",\"file_collections\":\"\",\"filelink_size\":0,\"filelink_sorting\":\"\",\"filelink_sorting_direction\":\"\",\"fcbigfoot_button_link\":\"\",\"tx_impexp_origuid\":3,\"crdate\":1744014582,\"t3ver_stage\":0,\"tstamp\":1744014582,\"uid\":20}',0,'0400$1292995152f2f554df58717da65e56f4:e4fcdfe5be41a63ffdd7ab7b888d9459'),
