lue = Special 6\\n        36 = TEXT\\n        36.value = Special 7\\n        37 = TEXT\\n        37.value = Special 8\\n        38 = TEXT\\n        38.value = Special 9\\n        39 = TEXT\\n        39.value = Special 10\\t\\t\\n\\t\\twrap = <div>|<\\/div>\\n    }\\n    11 = TEXT\\n    11 {\\n        value = colPos = {register:colPos}\\n        value.insertData = 1\\n        wrap = <div>|<\\/div>\\n    }\\n    90 = RESTORE_REGISTER\\n    wrap (\\n        <div class=\\\"frame frame-default frame-type-html frame-layout-0 frame-background-none frame-no-backgroundimage frame-space-before-none frame-space-after-none\\\">\\n            <div class=\\\"frame-inner\\\">\\n                <div class=\\\"example-grid\\\">|<\\/div>\\n            <\\/div>\\n        <\\/div>\\n    )\\n}\\nlib.dynamicContentSlide =< lib.dynamicContent\\nlib.dynamicContentSlide {\\n\\t20 = TEXT\\n\\t20.value = If no content element is found in this column, the rootLine will be traversed back until some content is found.\\n\\t20.wrap = <div>|<\\/div>\\n}\\n[global]\",\"crdate\":1744015096,\"tstamp\":1744015096,\"uid\":1}',0,'0400$ffa512cef72412454e8029f359a51712:35af6288617af54964e77af08c30949a'),
