\"frame_options\":\"\",\"background_color_class\":\"\",\"background_image_options\":null,\"header\":\"Eksempler\",\"header_link\":\"\",\"subheader\":\"\",\"bodytext\":\"<ul><li><strong>Bulgarian:<\\/strong> \\u0416\\u044a\\u043b\\u0442\\u0430\\u0442\\u0430 \\u0434\\u044e\\u043b\\u044f \\u0431\\u0435\\u0448\\u0435 \\u0449\\u0430\\u0441\\u0442\\u043b\\u0438\\u0432\\u0430, \\u0447\\u0435 \\u043f\\u0443\\u0445\\u044a\\u0442, \\u043a\\u043e\\u0439\\u0442\\u043e \\u0446\\u044a\\u0444\\u043d\\u0430, \\u0437\\u0430\\u043c\\u0440\\u044a\\u0437\\u043d\\u0430 \\u043a\\u0430\\u0442\\u043e \\u0433\\u044c\\u043e\\u043d.<\\/li><li><strong>Czech:<\\/strong> P\\u0159\\u00edli\\u0161 \\u017elu\\u0165ou\\u010dk\\u00fd k\\u016f\\u0148 \\u00fap\\u011bl \\u010f\\u00e1belsk\\u00e9 k\\u00f3dy.<\\/li><li><strong>Dutch:<\\/strong> Pa\'s w\\u0133ze lynx bezag vroom het fikse aquaduct.<\\/li><li><strong>English:<\\/strong> The quick brown fox jumps over the lazy dog.<\\/li><li><strong>Esperanto:<\\/strong> E\\u0125o\\u015dan\\u011do \\u0109iu\\u0135a\\u016dde.<\\/li><li><strong>French:<\\/strong> Les na\\u00effs \\u00e6githales h\\u00e2tifs pondant \\u00e0 No\\u00ebl o\\u00f9 il g\\u00e8le sont s\\u00fbrs d\'\\u00eatre d\\u00e9\\u00e7us et de voir leurs dr\\u00f4les d\'\\u0153ufs ab\\u00eem\\u00e9s.<\\/li><li><strong>German: <\\/strong>Falsches \\u00dcben von Xylophonmusik qu\\u00e4lt jeden gr\\u00f6\\u00dferen Zwerg. (1)<\\/li><li><strong>German: <\\/strong><span>Im finsteren Jagdschlo\\u00df am offenen Felsquellwasser patzte der affig-flatterhafte kauzig-h\\u00f6f\\u200cliche B\\u00e4cker \\u00fcber seinem versifften kniffligen C-Xylophon.<\\/span> (2)<\\/li><li><strong>Greek<\\/strong> (monotonic): \\u03be\\u03b5\\u03c3\\u03ba\\u03b5\\u03c0\\u03ac\\u03b6\\u03c9 \\u03c4\\u03b7\\u03bd \\u03c8\\u03c5\\u03c7\\u03bf\\u03c6\\u03b8\\u03cc\\u03c1\\u03b1 \\u03b2\\u03b4\\u03b5\\u03bb\\u03c5\\u03b3\\u03bc\\u03af\\u03b1<\\/li><li><strong>Greek<\\/strong> (polytonic): \\u03be\\u03b5\\u03c3\\u03ba\\u03b5\\u03c0\\u03ac\\u03b6\\u03c9 \\u03c4\\u1f74\\u03bd \\u03c8\\u03c5\\u03c7\\u03bf\\u03c6\\u03b8\\u03cc\\u03c1\\u03b1 \\u03b2\\u03b4\\u03b5\\u03bb\\u03c5\\u03b3\\u03bc\\u03af\\u03b1<\\/li><li><strong>Hebrew:<\\/strong> <span>\\u05d6\\u05d4 \\u05db\\u05d9\\u05e3 \\u05e1\\u05ea\\u05dd \\u05dc\\u05e9\\u05de\\u05d5\\u05e2 \\u05d0\\u05d9\\u05da \\u05ea\\u05e0\\u05e6\\u05d7 \\u05e7\\u05e8\\u05e4\\u05d3 \\u05e2\\u05e5 \\u05d8\\u05d5\\u05d1 \\u05d1\\u05d2\\u05df.<\\/span><\\/li><li><strong>Hungarian:<\\/strong> \\u00c1rv\\u00edzt\\u0171r\\u0151 t\\u00fck\\u00f6rf\\u00far\\u00f3g\\u00e9p.<\\/li><li><strong>Icelandic:<\\/strong> S\\u00e6v\\u00f6r gr\\u00e9t \\u00e1\\u00f0an \\u00fev\\u00ed \\u00falpan var \\u00f3n\\u00fdt.<\\/li><li><strong>Irish:<\\/strong> \\\"An \\u1e03fuil do \\u010bro\\u00ed ag buala\\u1e0b \\u00f3 \\u1e1fait\\u00edos an \\u0121r\\u00e1 a \\u1e41eall lena \\u1e57\\u00f3g \\u00e9ada \\u00f3 \\u1e61l\\u00ed do leasa \\u1e6b\\u00fa?\\\" \\\"D\'\\u1e1fuascail \\u00cdosa \\u00dar\\u1e41ac na h\\u00d3i\\u0121e Beannai\\u1e6be p\\u00f3r \\u00c9ava agus \\u00c1\\u1e0bai\\u1e41.\\\"<\\/li><li><strong>Jamaican:<\\/strong> Chruu, a kwik di kwik brong fox a jomp huova di liezi daag de, yu no siit?<\\/li><li><strong>Japanese<\\/strong> (Hiragana):<br>\\u3044\\u308d\\u306f\\u306b\\u307b\\u3078\\u3069\\u3000\\u3061\\u308a\\u306c\\u308b\\u3092<br>\\u308f\\u304c\\u3088\\u305f\\u308c\\u305e\\u3000\\u3064\\u306d\\u306a\\u3089\\u3080<br>\\u3046\\u3090\\u306e\\u304a\\u304f\\u3084\\u307e\\u3000\\u3051\\u3075\\u3053\\u3048\\u3066<br>\\u3042\\u3055\\u304d\\u3086\\u3081\\u307f\\u3058\\u3000\\u3091\\u3072\\u3082\\u305b\\u305a (4)<\\/li><li><strong>Polish:<\\/strong> Pchn\\u0105\\u0107 w t\\u0119 \\u0142\\u00f3d\\u017a je\\u017ca lub o\\u015bm skrzy\\u0144 fig.<\\/li><li><strong>Portuguese:<\\/strong> O pr\\u00f3ximo v\\u00f4o \\u00e0 noite sobre o Atl\\u00e2ntico, p\\u00f5e freq\\u00fcentemente o \\u00fanico m\\u00e9dico. (3)<\\/li><li><strong>Sami (Northern):<\\/strong> Vuol Ruo\\u0167a ge\\u0111ggiid leat m\\u00e1\\u014bga luosa ja \\u010duov\\u017e\\u017ea.<\\/li><li><strong>Slovak:<\\/strong> Star\\u00fd k\\u00f4\\u0148 na h\\u0155be kn\\u00edh \\u017euje t\\u00ed\\u0161ko pov\\u00e4dnut\\u00e9 ru\\u017ee, na st\\u013ape sa \\u010fate\\u013e u\\u010d\\u00ed kv\\u00e1ka\\u0165 nov\\u00fa \\u00f3du o \\u017eivote.<\\/li><li><strong>Spanish:<\\/strong> El ping\\u00fcino Wenceslao hizo kil\\u00f3metros bajo exhaustiva lluvia y fr\\u00edo, a\\u00f1oraba a su querido cachorro.<\\/li><li><strong>Swedish:<\\/strong> Flygande b\\u00e4ckasiner s\\u00f6ka strax hwila p\\u00e5 mjuka tuvor.<\\/li><li><strong>Russian:<\\/strong> \\u0421\\u044a\\u0435\\u0448\\u044c \\u0436\\u0435 \\u0435\\u0449\\u0451 \\u044d\\u0442\\u0438\\u0445 \\u043c\\u044f\\u0433\\u043a\\u0438\\u0445 \\u0444\\u0440\\u0430\\u043d\\u0446\\u0443\\u0437\\u0441\\u043a\\u0438\\u0445 \\u0431\\u0443\\u043b\\u043e\\u043a \\u0434\\u0430 \\u0432\\u044b\\u043f\\u0435\\u0439 \\u0447\\u0430\\u044e.<\\/li><li><strong>Russian:<\\/strong> \\u0412 \\u0447\\u0430\\u0449\\u0430\\u0445 \\u044e\\u0433\\u0430 \\u0436\\u0438\\u043b-\\u0431\\u044b\\u043b \\u0446\\u0438\\u0442\\u0440\\u0443\\u0441? \\u0414\\u0430, \\u043d\\u043e \\u0444\\u0430\\u043b\\u044c\\u0448\\u0438\\u0432\\u044b\\u0439 \\u044d\\u043a\\u0437\\u0435\\u043c\\u043f\\u043b\\u044f\\u0440! \\u0451\\u044a.<\\/li><\\/ul>\",\"imageborder\":0,\"image_zoom\":0,\"pages\":\"\",\"records\":\"\",\"linkToTop\":0,\"pi_flexform\":null,\"selected_categories\":0,\"category_field\":\"\",\"file_collections\":\"\",\"filelink_size\":0,\"filelink_sorting\":\"\",\"filelink_sorting_direction\":\"\",\"crdate\":1744015096,\"t3ver_stage\":0,\"tstamp\":1744015096,\"uid\":225}',0,'0400$ffa512cef72412454e8029f359a51712:30f178aa82b1e5be792c0e9172bac232'),
