(524,1744015096,1,'BE',2,0,12,'tx_bootstrappackage_icon_group_item','{\"tt_content\":0,\"starttime\":0,\"endtime\":0,\"l10n_parent\":0,\"pid\":66,\"sorting\":128,\"hidden\":0,\"sys_language_uid\":0,\"l10n_state\":null,\"t3_origuid\":1,\"l10n_diffsource\":\"{\\\"tt_content\\\":\\\"\\\",\\\"icon_file\\\":\\\"\\\"}\",\"header\":\"Pellentesque habitant morbi\",\"subheader\":\"Vestibulum dapibus nunc ac augue\",\"bodytext\":null,\"link\":\"\",\"icon_set\":\"\",\"icon_identifier\":\"\",\"crdate\":1744015096,\"t3ver_stage\":0,\"tstamp\":1744015096,\"uid\":12}',0,'0400$ffa512cef72412454e8029f359a51712:ef1dabdaaace9949e54aed7bc5014703'),
(525,1744015096,1,'BE',2,0,1,'tx_bootstrappackage_card_group_item','{\"tt_content\":0,\"starttime\":0,\"endtime\":0,\"l10n_parent\":0,\"pid\":95,\"sorting\":256,\"hidden\":0,\"sys_language_uid\":0,\"l10n_state\":null,\"t3_origuid\":0,\"l10n_diffsource\":\"{\\\"tt_content\\\":\\\"\\\"}\",\"header\":\"On-page Search Engine Optimization (SEO)\",\"subheader\":\"\",\"bodytext\":\"<p>A major part of getting on-page SEO right is consistency. With TYPO3 you can optimize for search engines on the go as you create individual pages with features like URL structure, page titles, and headers. It also allows you to quickly add your own meta description and meta tags.<\\/p>\",\"link\":\"\",\"link_title\":\"\",\"link_icon_set\":\"\",\"link_icon_identifier\":\"\",\"link_class\":\"default\",\"crdate\":1744015096,\"t3ver_stage\":0,\"tstamp\":1744015096,\"uid\":1}',0,'0400$ffa512cef72412454e8029f359a51712:16d558ba55a561e0fb658c19747eff87'),
(526,1744015096,1,'BE',2,0,2,'tx_bootstrappackage_card_group_item','{\"tt_content\":0,\"starttime\":0,\"endtime\":0,\"l10n_parent\":0,\"pid\":95,\"sorting\":128,\"hidden\":0,\"sys_language_uid\":0,\"l10n_state\":null,\"t3_origuid\":0,\"l10n_diffsource\":\"{\\\"tt_content\\\":\\\"\\\"}\",\"header\":\"Content history and auditing\",\"subheader\":\"\",\"bodytext\":\"<p>TYPO3 CMS keeps a full, unlimited, auditable history of content publication and revision. Browse all changes in a visual data comparison via \\u201cdiff\\u201d and selectively undo, or even undelete!<\\/p>\",\"link\":\"\",\"link_title\":\"\",\"link_icon_set\":\"\",\"link_icon_identifier\":\"\",\"link_class\":\"default\",\"crdate\":1744015096,\"t3ver_stage\":0,\"tstamp\":1744015096,\"uid\":2}',0,'0400$ffa512cef72412454e8029f359a51712:7be6ef1f2360f1230565e72b585b2fd2'),
(527,1744015096,1,'BE',2,0,3,'tx_bootstrappackage_card_group_item','{\"tt_content\":0,\"starttime\":0,\"endtime\":0,\"l10n_parent\":0,\"pid\":95,\"sorting\":64,\"hidden\":0,\"sys_language_uid\":0,\"l10n_state\":null,\"t3_origuid\":0,\"l10n_diffsource\":\"{\\\"tt_content\\\":\\\"\\\"}\",\"header\":\"Mobile apps, responsive sites\",\"subheader\":\"\",\"bodytext\":\"<p>Use TYPO3 CMS as the content management, business logic, and content provider for native mobile applications and front-end frameworks, as well as fully-responsive websites for website visitors and admins.<\\/p>\",\"link\":\"\",\"link_title\":\"\",\"link_icon_set\":\"\",\"link_icon_identifier\":\"\",\"link_class\":\"default\",\"crdate\":1744015096,\"t3ver_stage\":0,\"tstamp\":1744015096,\"uid\":3}',0,'0400$ffa512cef72412454e8029f359a51712:c6c6ee894916f042941b10a8368684f4'),
(528,1744015096,1,'BE',2,0,4,'tx_bootstrappackage_card_group_item','{\"tt_content\":0,\"starttime\":0,\"endtime\":0,\"l10n_parent\":0,\"pid\":95,\"sorting\":32,\"hidden\":0,\"sys_language_uid\":0,\"l10n_state\":null,\"t3_origuid\":0,\"l10n_diffsource\":\"{\\\"tt_content\\\":\\\"\\\"}\",\"header\":\"Any data, any source\",\"subheader\":\"\",\"bodytext\":\"<p>The TYPO3 CMS file system abstraction layer can use and combine any number of file storage systems and locations while remaining completely transparent to editors. Existing file service integrations include Akamai, Alfresco, SixOMC, Cumulus, QBank DAM, Dropbox, Magento, Bynder, and Amazon S3.<\\/p>\",\"link\":\"\",\"link_title\":\"\",\"link_icon_set\":\"\",\"link_icon_identifier\":\"\",\"link_class\":\"default\",\"crdate\":1744015096,\"t3ver_stage\":0,\"tstamp\":1744015096,\"uid\":4}',0,'0400$ffa512cef72412454e8029f359a51712:858bd4b9e0999dc965f9dcb7d2f23f26'),
(529,1744015096,1,'BE',2,0,5,'tx_bootstrappackage_card_group_item','{\"tt_content\":0,\"starttime\":0,\"endtime\":0,\"l10n_parent\":0,\"pid\":95,\"sorting\":16,\"hidden\":0,\"sys_language_uid\":0,\"l10n_state\":null,\"t3_origuid\":0,\"l10n_diffsource\":\"{\\\"tt_content\\\":\\\"\\\"}\",\"header\":\"Multilingual\",\"subheader\":\"\",\"bodytext\":\"<p>Deploy your content (or localised copies of your website in a multisite installation) in 56 languages. TYPO3 CMS websites and multisite installations support a variety of translation and localisation models and workflows.<\\/p>\",\"link\":\"\",\"link_title\":\"\",\"link_icon_set\":\"\",\"link_icon_identifier\":\"\",\"link_class\":\"default\",\"crdate\":1744015096,\"t3ver_stage\":0,\"tstamp\":1744015096,\"uid\":5}',0,'0400$ffa512cef72412454e8029f359a51712:d87e023af20bbd9cde5be1cb680efd8f'),
(530,1744015096,1,'BE',2,0,6,'tx_bootstrappackage_card_group_item','{\"tt_content\":0,\"starttime\":0,\"endtime\":0,\"l10n_parent\":0,\"pid\":95,\"sorting\":8,\"hidden\":0,\"sys_language_uid\":0,\"l10n_state\":null,\"t3_origuid\":0,\"l10n_diffsource\":\"{\\\"tt_content\\\":\\\"\\\"}\",\"header\":\"Multisite\",\"subheader\":\"\",\"bodytext\":\"<p>A single TYPO3 CMS installation can power multiple sites, efficiently sharing configuration, templates, branding, and content where needed. Point multiple domains to different entry points of your TYPO3 multisite installation.<\\/p>\",\"link\":\"\",\"link_title\":\"\",\"link_icon_set\":\"\",\"link_icon_identifier\":\"\",\"link_class\":\"default\",\"crdate\":1744015096,\"t3ver_stage\":0,\"tstamp\":1744015096,\"uid\":6}',0,'0400$ffa512cef72412454e8029f359a51712:ae0c0665bf3cd9851f3e40e811e3d36b');
