(1,80,1744015096,1744015096,0,0,0,0,256,NULL,'Grid Example (overrides content selection for subpages)',0,0,NULL,'','',0,'[tree.level === 2]\n# DEMO CSS\npage.cssInline {\n    100 = TEXT\n    100.value (\n    .example-grid { border: 1px solid rgba(117, 167, 90, 0.5); background-color: rgba(117, 167, 90, 0.25); padding: 2em; }\n    )\n}\n\n# Override Content Selection\nlib.dynamicContent >\nlib.dynamicContent = COA\nlib.dynamicContent {\n    5 = LOAD_REGISTER\n    5 {\n        colPos.cObject = TEXT\n        colPos.cObject {\n            field = colPos\n            ifEmpty.cObject = TEXT\n            ifEmpty.cObject {\n                value.current = 1\n                ifEmpty = 0\n            }\n        }\n    }\n    10 = CASE\n    10 {\n        key.data = register:colPos\n        0 = TEXT\n        0.value = Main\n        1 = TEXT\n        1.value = Left\n        2 = TEXT\n        2.value = Right\n        3 = TEXT\n        3.value = Border\n        4 = TEXT\n        4.value = Main 2\n        8 = TEXT\n        8.value = Content Before\n        9 = TEXT\n        9.value = Content After\n        10 = TEXT\n        10.value = Footer 1\n        11 = TEXT\n        11.value = Footer 2\n        12 = TEXT\n        12.value = Footer 3\n        20 = TEXT\n        20.value = Middle 1\n        21 = TEXT\n        21.value = Middle 2\n        22 = TEXT\n        22.value = Middle 3\n        30 = TEXT\n        30.value = Special 1\n        31 = TEXT\n        31.value = Special 2\n        32 = TEXT\n        32.value = Special 3\n        33 = TEXT\n        33.value = Special 4\n        34 = TEXT\n        34.value = Special 5\n        35 = TEXT\n        35.value = Special 6\n        36 = TEXT\n        36.value = Special 7\n        37 = TEXT\n        37.value = Special 8\n        38 = TEXT\n        38.value = Special 9\n        39 = TEXT\n        39.value = Special 10		\n		wrap = <div>|</div>\n    }\n    11 = TEXT\n    11 {\n        value = colPos = {register:colPos}\n        value.insertData = 1\n        wrap = <div>|</div>\n    }\n    90 = RESTORE_REGISTER\n    wrap (\n        <div class=\"frame frame-default frame-type-html frame-layout-0 frame-background-none frame-no-backgroundimage frame-space-before-none frame-space-after-none\">\n            <div class=\"frame-inner\">\n                <div class=\"example-grid\">|</div>\n            </div>\n        </div>\n    )\n}\nlib.dynamicContentSlide =< lib.dynamicContent\nlib.dynamicContentSlide {\n	20 = TEXT\n	20.value = If no content element is found in this column, the rootLine will be traversed back until some content is found.\n	20.wrap = <div>|</div>\n}\n[global]',0,1),
(2,15,1744016595,1744015096,1,0,0,0,256,'','Introduction Package',1,3,'[tree.level === 0]\npage.theme.navigation.style = default-transition\n[end]\n\npage.theme.navigation.type = top\npage.theme.meta.enable = 0\npage.logo.file = fileadmin/introduction/images/introduction-package.svg\npage.logo.fileInverted = fileadmin/introduction/images/introduction-package-inverted.svg\npage.theme.socialmedia.channels.facebook.url = https://www.facebook.com/typo3/\npage.theme.socialmedia.channels.x.url = https://x.com/typo3\npage.theme.socialmedia.channels.github.url = https://github.com/TYPO3/typo3\npage.theme.socialmedia.channels.youtube.url = https://www.youtube.com/user/typo3\npage.theme.cookieconsent.position = bottom-right\n','EXT:bootstrap_package/Configuration/TypoScript','',0,'',3,2);
